.text 

.globl main
main:	
	jal 	clear_screen
	sw	$zero, game_state		# game_state = zero
	jal	start_screen
	la 	$t0, 0xffff0000  		# check if a key_press happened
	lw 	$t1, 0($t0) 
	beq 	$t1, 1, key_press_start
	jal 	sleep
	j	main
	
key_press_start:
	lw 	$t0, 4($t0) 
	beq	$t0, 0x77, start		# w to start
	beq 	$t0, 0x73, exit_start		# s to exit
	
start:	
	jal	print_start_1
	jal	sleep
	addi	$t0, $zero, 14848		# declear start pos of girl
	sw	$t0, girl
	addi	$t0, $zero, 1			# declear iteration number as 1
	sw	$t0, iteration
	j	main_loop
	
exit_start:
	jal	print_start_2
	jal	sleep
	jal	sleep
	jal	sleep
	j	exit

exit:
	jal	print_start_3
	jal	sleep
	jal	clear_screen
	li	$v0, 10
	syscall

main_loop:
	la	$s0, BASE_ADDRESS
	jal 	clear_screen
	
	lw 	$s6, level		# get the level
	beq	$s6, 3, level_3
	beq	$s6, 2, level_2
	jal 	background_1
	j	continue_drawing

level_3:
	jal 	background_3
	j	continue_drawing

level_2:
	jal	background_2
	j	continue_drawing
	
continue_drawing:
	lw	$s1, girl			# player start position in s1
	add	$s5, $zero, $zero
	jal 	check_collision			# 1 if collision with platform, 0 if no collision 
	bne	$s5, 1, end_check
	jal 	player
	j 	cont
	
end_check:
	add 	$s1, $s1, 256
	sw	$s1, girl
	jal 	player
	
cont:
	la 	$t0, 0xffff0000  		# check if a key_press happened
	lw 	$t1, 0($t0)
	beq	$t1, 1, key_press		
	jal	sleep
	#j 	exit
	j 	main_loop

################# handle key presses ######################
key_press:
	lw 	$t0, 4($t0)
	beq 	$t0, 0x61, a_pressed
	beq 	$t0, 0x64, d_pressed
	beq 	$t0, 0x77, w_pressed
	beq	$t0, 0x70, p_pressed
	j	no_key

a_pressed:
	lw	$s1, girl			# player start position in s1
	li	$t0, 256
	div	$s1, $t0
	mfhi	$t0
	beq	$t0, 0, no_key
	addi	$s1, $s1, -8
	sw	$s1, girl
	j	no_key

d_pressed:
	lw	$s1, girl
	addi	$t1, $s1, 5
	li 	$t0, 256
	div	$t1, $t0
	mfhi	$t0
	bgt	$t0, 236, no_key
	addi	$s1, $s1, 8
	sw	$s1, girl
	j 	no_key
		
w_pressed:
	lw	$s1, girl
	addi	$s1, $s1, -1536
	sw	$s1, girl
	j 	no_key
	
p_pressed:
	j main
	
no_key:
	j main_loop
################# clear screen ############################
clear_screen:
	la	$t0, BASE_ADDRESS
	la	$t1, 0($t0)
	la 	$t2, 16384($t0)
	la 	$t3, 0x000000	# load black
	
clear:	beq	$t1, $t2, end_clr_screen
	sw	$t3, 0($t1)
	addi	$t1, $t1, 4
	j	clear

end_clr_screen:
	jr 	$ra
	
################# load start screen #######################	
start_screen:
      li 	$t0, BASE_ADDRESS
      la 	$t1, START_SCREEN
      li 	$t2, 0
starting_loop: 
      beq 	$t2, 6000, end_start_loop
      lw 	$t3, 0($t1)
      beq 	$t3, 0X00000000, update_start_l 	# only draw non-black bg
      sw 	$t3, 0($t0) 
update_start_l:  
      addi 	$t0, $t0, 4
      addi 	$t1, $t1, 4
      addi 	$t2, $t2, 1
      j 	starting_loop
end_start_loop:     
      jr 	$ra

sleep:
      li 	$v0, 32    
      lw	$s7, WAIT_TIME  
      add 	$a0, $zero, $s7
      syscall
      jr 	$ra

################## load background #######################
background_1: 
      li 	$t0, BASE_ADDRESS
      la 	$t1, BACKGROUND_1
      li 	$t2, 0
      
background_1_loop: 
      #beq $t2, 6000, end_bg_loop
      beq 	$t2, 16000, end_bg_1_loop
      lw 	$t3, 0($t1)
      #beq $t3, 0X00000000, update_bg_l
      sw 	$t3, 0($t0) 
      
update_bg_1_l:  
      addi 	$t0, $t0, 4
      addi 	$t1, $t1, 4
      addi 	$t2, $t2, 1
      j 	background_1_loop
      
end_bg_1_loop:      
      jr 	$ra

background_2: 
      li 	$t0, BASE_ADDRESS
      la 	$t1, BACKGROUND_2
      li 	$t2, 0
      
background_2_loop: 
      #beq $t2, 6000, end_bg_loop
      beq 	$t2, 16000, end_bg_2_loop
      lw 	$t3, 0($t1)
      #beq $t3, 0X00000000, update_bg_l
      sw 	$t3, 0($t0) 
      
update_bg_2_l:  
      addi 	$t0, $t0, 4
      addi 	$t1, $t1, 4
      addi 	$t2, $t2, 1
      j 	background_2_loop
      
end_bg_2_loop:      
      jr 	$ra
      

background_3: 
      li 	$t0, BASE_ADDRESS
      la 	$t1, BACKGROUND_3
      li 	$t2, 0
      
background_3_loop: 
      #beq $t2, 6000, end_bg_loop
      beq 	$t2, 16000, end_bg_3_loop
      lw 	$t3, 0($t1)
      #beq $t3, 0X00000000, update_bg_l
      sw 	$t3, 0($t0) 
      
update_bg_3_l:  
      addi 	$t0, $t0, 4
      addi 	$t1, $t1, 4
      addi 	$t2, $t2, 1
      j 	background_3_loop
      
end_bg_3_loop:      
      jr 	$ra

#################### player ###############################
player:
	lw	$t0, girl
	add	$t0, $s1, $zero
	la 	$t1, PLAYER
	#lw 	$t0, PLAYER_POS
	addi	$t0, $t0, BASE_ADDRESS
	li 	$t2, 0
	
start_outer:
	beq 	$t2, 4, end_outer
	li 	$t3, 0
	
start_inner: 
	beq 	$t3, 5, update_inner
	lw 	$t4, 0($t1)
	sw 	$t4, 0($t0)
	addi 	$t1, $t1, 4
	addi 	$t0, $t0, 4
	addi 	$t3, $t3, 1
	j 	start_inner

update_inner:
	sub 	$t0, $t0, 20
	addi 	$t0, $t0, 256
	addi 	$t2, $t2, 1
	j 	start_outer

end_outer:
	jr $ra

##############################################

#################### fire ###############################
fire:
	lw	$t0, fire1
	add	$t0, $s2, $zero
	la 	$t1, FIRE_DOWN
	addi	$t0, $t0, BASE_ADDRESS
	li 	$t2, 0
	
start_outer_fire:
	beq 	$t2, 4, end_outer_fire
	li 	$t3, 0
	
start_inner_fire: 
	beq 	$t3, 5, update_inner_fire
	lw 	$t4, 0($t1)
	sw 	$t4, 0($t0)
	addi 	$t1, $t1, 4
	addi 	$t0, $t0, 4
	addi 	$t3, $t3, 1
	j 	start_inner_fire

update_inner_fire:
	sub 	$t0, $t0, 20
	addi 	$t0, $t0, 256
	addi 	$t2, $t2, 1
	j 	start_outer_fire

end_outer_fire:
	jr $ra

##############################################
#################### fire2 ###############################
fire_2:
	lw	$t0, fire2
	add	$t0, $s3, $zero
	la 	$t1, FIRE_DOWN
	addi	$t0, $t0, BASE_ADDRESS
	li 	$t2, 0
	
start_outer_fire_2:
	beq 	$t2, 4, end_outer_fire_2
	li 	$t3, 0
	
start_inner_fire_2: 
	beq 	$t3, 5, update_inner_fire_2
	lw 	$t4, 0($t1)
	sw 	$t4, 0($t0)
	addi 	$t1, $t1, 4
	addi 	$t0, $t0, 4
	addi 	$t3, $t3, 1
	j 	start_inner_fire_2

update_inner_fire_2:
	sub 	$t0, $t0, 20
	addi 	$t0, $t0, 256
	addi 	$t2, $t2, 1
	j 	start_outer_fire_2

end_outer_fire_2:
	jr $ra

##############################################
############# COLLISIONS ####################
check_collision:
	lw 	$s0, girl			# load in player position
	addi	$t0, $s0, 1024			# get the position exactly under the player 
	add	$t0, $t0, BASE_ADDRESS
	addi	$t1, $s0, 1028			#position under player's left foot
	add	$t1, $t1, BASE_ADDRESS
	addi	$t2, $s0, 1032			#position under player's left foot
	add	$t2, $t2, BASE_ADDRESS
	addi	$t3, $s0, 1036			#position under player's left foot
	add	$t3, $t3, BASE_ADDRESS
	lw	$t0, 0($t0)
	lw	$t1, 0($t1)
	lw	$t2, 0($t2)
	lw	$t3, 0($t3)			# check if this position is equal to white
	beq	$t0, 0xffffff, true_plat	# s5 stores whether ther is collision or not 	
	beq	$t1, 0xffffff, true_plat
	beq	$t2, 0xffffff, true_plat
	beq	$t3, 0xffffff, true_plat
	beq	$t0, 0x474345, win_level
	beq	$t0, 0xff7700, lose
	j	false
lose:
	addi 	$t0, $zero, 1
	sw	$t0, level
	jal	draw_lose
	li 	$v0, 32    
      	addi	$t0, $zero, 5000 
      	add 	$a0, $zero, $t0
      	syscall
	j	main
	
win_level:
	lw	$t0, level
	addi	$t0, $t0, 1
	sw	$t0, level
	beq	$t0, 4, win_game
	beq	$t0, 3, level_3_start
	beq	$t0, 2, level_2_start
	
level_2_start:
	addi	$t0, $zero, 14952
	sw	$t0, girl
	j	main_loop

level_3_start:
	addi	$t0, $zero, 14848
	sw	$t0, girl
	j	main_loop
		
win_game:
	jal	draw_win
	li 	$v0, 32    
     	lw	$s7, 10000  
      	add 	$a0, $zero, $s7
      	syscall
	jal	exit
true_plat:
	addi	$t0, $s0, 1028			# get the position exactly under the player 
	add	$t0, $t0, BASE_ADDRESS
	lw	$t0, 0($t0)
	bne	$t0, 0xffffff, false
	addi	$t0, $s0, 1032			# get the position exactly under the player 
	add	$t0, $t0, BASE_ADDRESS
	lw	$t0, 0($t0)
	bne	$t0, 0xffffff, false
	add 	$s5, $zero, 1
	j 	end_collision
false: 
	add $s5, $zero, $zero
	j end_collision

end_collision:
	jr $ra	

######## draw winner screeen ##############################
draw_win: 
      li 	$t0, BASE_ADDRESS
      la 	$t1, WINNER_SCREEN
      li 	$t2, 0
      
win_loop: 
      beq 	$t2, 16000, end_win_loop
      lw 	$t3, 0($t1)
      sw 	$t3, 0($t0) 
      
update_win_l:  
      addi 	$t0, $t0, 4
      addi 	$t1, $t1, 4
      addi 	$t2, $t2, 1
      j 	win_loop
      
end_win_loop:      
      jr 	$ra

######## draw loser screeen ##############################
draw_lose: 
      li 	$t0, BASE_ADDRESS
      la 	$t1, LOSE_SCREEN
      li 	$t2, 0
      
lose_loop: 
      beq 	$t2, 16000, end_lose_loop
      lw 	$t3, 0($t1)
      sw 	$t3, 0($t0) 
      
update_lose_l:  
      addi 	$t0, $t0, 4
      addi 	$t1, $t1, 4
      addi 	$t2, $t2, 1
      j 	lose_loop
      
end_lose_loop:      
      jr 	$ra

#################### start and end feedback screens ###########
print_start_1: 
      li 	$t0, BASE_ADDRESS
      la 	$t1, START_1
      li 	$t2, 0
      
print_1_loop: 
      #beq $t2, 6000, end_bg_loop
      beq 	$t2, 16000, end_p_1_loop
      lw 	$t3, 0($t1)
      #beq $t3, 0X00000000, update_bg_l
      sw 	$t3, 0($t0) 
      
update_p_1_l:  
      addi 	$t0, $t0, 4
      addi 	$t1, $t1, 4
      addi 	$t2, $t2, 1
      j 	print_1_loop
      
end_p_1_loop:      
      jr 	$ra
      
print_start_2: 
      li 	$t0, BASE_ADDRESS
      la 	$t1, START_2
      li 	$t2, 0
      
print_2_loop: 
      #beq $t2, 6000, end_bg_loop
      beq 	$t2, 16000, end_p_2_loop
      lw 	$t3, 0($t1)
      #beq $t3, 0X00000000, update_bg_l
      sw 	$t3, 0($t0) 
      
update_p_2_l:  
      addi 	$t0, $t0, 4
      addi 	$t1, $t1, 4
      addi 	$t2, $t2, 1
      j 	print_2_loop
      
end_p_2_loop:      
      jr 	$ra
      
print_start_3: 
      li 	$t0, BASE_ADDRESS
      la 	$t1, START_3
      li 	$t2, 0
      
print_3_loop: 
      #beq $t2, 6000, end_bg_loop
      beq 	$t2, 16000, end_p_3_loop
      lw 	$t3, 0($t1)
      #beq $t3, 0X00000000, update_bg_l
      sw 	$t3, 0($t0) 
      
update_p_3_l:  
      addi 	$t0, $t0, 4
      addi 	$t1, $t1, 4
      addi 	$t2, $t2, 1
      j 	print_3_loop
      
end_p_3_loop:      
      jr 	$ra
      
